package com.kraftlabs.crm_new.LocationTracker.database;import com.google.gson.annotations.SerializedName;import java.util.Date;/** * User: Ashik * Date: 30-Jul-18 * Time: 2:34 PM */public class LocModel {    @SerializedName("local_id")    private long id;    @SerializedName("user_device_id")    private String deviceId;    @SerializedName("time")    private Date time;    @SerializedName("latitude")    private double latitude;    @SerializedName("speed")    private double speed;    @SerializedName("altitude")    private double altitude;    @SerializedName("longitude")    private double longitude;    @SerializedName("battery")    private double battery;    @SerializedName("accuracy")    private double accuracy;    @SerializedName("date")    private String date;    @SerializedName("user_id")    private int userId;    @SerializedName("provider")    private String provider;    @SerializedName("id")    private int serverId;    @SerializedName("device_id")    private String userDeviceId;    @SerializedName("version_name")    private String versionName;    public LocModel(long id, String deviceId, Date time, double latitude, double speed, double altitude, double longitude, double battery, double accuracy, String date, int userId, String provider, int serverId, String userDeviceId, String versionName) {        this.id = id;        this.deviceId = deviceId;        this.time = time;        this.latitude = latitude;        this.speed = speed;        this.altitude = altitude;        this.longitude = longitude;        this.battery = battery;        this.accuracy = accuracy;        this.date = date;        this.userId = userId;        this.provider = provider;        this.serverId = serverId;        this.userDeviceId = userDeviceId;        this.versionName = versionName;    }    public LocModel() {    }    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getDeviceId() {        return deviceId;    }    public void setDeviceId(String deviceId) {        this.deviceId = deviceId;    }    public Date getTime() {        return time;    }    public void setTime(Date time) {        this.time = time;    }    public double getLatitude() {        return latitude;    }    public void setLatitude(double latitude) {        this.latitude = latitude;    }    public double getSpeed() {        return speed;    }    public void setSpeed(double speed) {        this.speed = speed;    }    public double getAltitude() {        return altitude;    }    public void setAltitude(double altitude) {        this.altitude = altitude;    }    public double getLongitude() {        return longitude;    }    public void setLongitude(double longitude) {        this.longitude = longitude;    }    public double getBattery() {        return battery;    }    public void setBattery(double battery) {        this.battery = battery;    }    public double getAccuracy() {        return accuracy;    }    public void setAccuracy(double accuracy) {        this.accuracy = accuracy;    }    public String getDate() {        return date;    }    public void setDate(String date) {        this.date = date;    }    public int getUserId() {        return userId;    }    public void setUserId(int userId) {        this.userId = userId;    }    public String getProvider() {        return provider;    }    public void setProvider(String provider) {        this.provider = provider;    }    public int getServerId() {        return serverId;    }    public void setServerId(int serverId) {        this.serverId = serverId;    }    public String getUserDeviceId() {        return userDeviceId;    }    public void setUserDeviceId(String userDeviceId) {        this.userDeviceId = userDeviceId;    }    public String getVersionName() {        return versionName;    }    public void setVersionName(String versionName) {        this.versionName = versionName;    }    @Override    public String toString() {        return "LocModel{" +                "id=" + id +                ", deviceId='" + deviceId + '\'' +                ", time=" + time +                ", latitude=" + latitude +                ", speed=" + speed +                ", altitude=" + altitude +                ", longitude=" + longitude +                ", battery=" + battery +                ", accuracy=" + accuracy +                ", date='" + date + '\'' +                ", userId=" + userId +                ", provider='" + provider + '\'' +                ", serverId=" + serverId +                ", userDeviceId='" + userDeviceId + '\'' +                ", versionName='" + versionName + '\'' +                '}';    }}